the following steps are enabled on `lib-postgres-prod1`

```sql
ALTER SYSTEM SET auto_explain.log_min_duration = 60000;
ALTER SYSTEM SET auto_explain.log_analyze = on;
ALTER SYSTEM SET auto_explain.log_triggers = on;
ALTER SYSTEM SET auto_explain.log_nested_statements = on;
```

These should be added to the `/etc/postgresql/{version}/main/postgresql.conf`
